import React, { Component } from 'react'
import styled from 'styled-components';

const CardPDiv = styled.div`
  display: grid;
  grid-template-columns: repeat(9, 1fr); 
  gap: 8px; 
`;

const TempColumn = styled.div`
  text-align: center;
  padding: 8px;
  background-color: #eee;
  border: 1px solid #ccc;
`;

const TempRow = styled.div`
  text-align: center;
  padding: 8px;
  background-color: #eee;
  border: 1px solid #ccc;
`;
const HourColumn = styled.div`
  text-align: center;
  padding: 8px;
  background-color: #eee;
  border: 1px solid #ccc;
`;
export class CardP extends Component {
  render() {
    return (
      <CardPDiv>
      <TempColumn> 
      <TempRow>0</TempRow>
      <TempRow>20</TempRow>
      <TempRow>40</TempRow>
      </TempColumn>
        <HourColumn>0</HourColumn>
        <HourColumn>3</HourColumn>
        <HourColumn>6</HourColumn>
        <HourColumn>9</HourColumn>
        <HourColumn>12</HourColumn>
         <HourColumn>15</HourColumn>
        <HourColumn>18</HourColumn>
        <HourColumn>21</HourColumn>
        <HourColumn>24</HourColumn>
        

      </CardPDiv>
    )
  }
}

export default CardP
